<template>
  <div id="app" class="w-screen h-screen">
    <v-offline
      @detected-condition="amIOnline"
      online-class="online"
      offline-class="offline"
    >
      <template v-if="online"
        ><component :is="layout">
          <router-view :layout.sync="layout" /> </component
      ></template>
      <template v-else>
        <div>
          <div style="padding: 1rem; margin: 1rem">
            <img :src="offlineLogo" style="width: 150px" />
            <!-- {{ offlineLogo }} -->
          </div>
          <div class="division" style="margin-top: 5%">
            <img :src="noInternet" style="width: 15%" />
            <!-- {{ noInternet }} -->
          </div>
          <div class="division" style="margin-top: 1.5rem">
            <h1 class="heading">No Internet Access</h1>
          </div>
          <div class="division" style="margin-top: 1.5rem">
            <p class="para">
              Please check your network connection and try again.
            </p>
          </div>
          <div class="division"></div>
          <div class="division" style="margin-top: 1.5rem">
            <el-button type="danger" @click="backToHome">Reload</el-button>
          </div>
        </div>
      </template>
    </v-offline>
  </div>
</template>

<script>
import { VOffline } from "v-offline";
export default {
  name: "App",
  components: {
    VOffline,
  },
  data() {
    return {
      layout: "div",
      online: true,
      offlineLogo:
        "data:image/png;base64,",
      noInternet:
        "data:image/png;base64,",
    };
  },
  metaInfo() {
    return {
      title: "eSigns: Electronic Signature Software on a free trial ",
      meta: [
        {
          name: "description",
          content:
            "Start exploring the joy of working in a paperless work environment with eSigns the next-generation software that offers free electronic signature for a trial period. ",
        },
        {
          property: "og:title",
          content: "eSigns: Electronic Signature Software on a free trial",
        },
        { property: "og:site_name", content: "eSigns" },
        { property: "og:type", content: "website" },
        { name: "robots", content: "index,follow" },
      ],
    };
  },
  methods: {
    amIOnline(e) {
      console.log(e);
      this.online = e;
    },
    backToHome() {
      // this.$router.push({
      //   path: "/",
      // });
      this.$router.go();
    },
  },
};
</script>
<style lang="scss"></style>
<style lang="scss">
* {
  margin: 0;
}
.offline {
  /* width: 100%;
  height: 100%;
  background-color: #fc9842;
  background-image: linear-gradient(315deg, #fc9842 0%, #fe5f75 74%); */
  .division {
    text-align: center;
  }
  .para {
    font-size: 19px;
    font-weight: 300;
    color: rgb(0, 0, 0);
  }
  .heading {
    font-size: 33px;
    font-weight: 500;
    color: black;
  }
}
.online {
  /* width: 100%;
  height: 100%;
  background-color: #00b712;
  background-image: linear-gradient(315deg, #00b712 0%, #9bca15 74%); */
}
</style>
